// Import necessary components and libraries
import { Route, BrowserRouter as Router, Switch } from 'react-router-dom';

// Other imports...

function App() {
  // ...

  return (
    <div className="product">
      {/* ... existing code ... */}
      <button
        style={{ borderRadius: "5px", background: "#373B61", padding: "0.5%", border: "#373B61" }}
      >
        <Link to="/products/filtered" style={{ color: "white", textDecoration: "none" }}>
          Show Low Quantity Products
        </Link>
      </button>
      {/* ... existing code ... */}
    </div>
  );
}

function FilteredProducts({ products }) {
  // Render the filtered products in a table
  return (
    <div className="filtered-products">
      <h1>Low Quantity Products</h1>
      <table className="table">
        <thead>
          {/* Table headers */}
        </thead>
        <tbody>
          {products
            .filter((product) => product.rquantity < 5)
            .map((product, index) => (
              <tr key={product._id}>
                {/* Display product details here */}
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
}

function MainApp() {
  return (
    <Router>
      <Switch>
        <Route path="/products/filtered">
          <FilteredProducts products={products} />
        </Route>
        <Route path="/">
          <App />
        </Route>
      </Switch>
    </Router>
  );
}

export default MainApp;
